// import dependencies:
import React from 'react';
import Header from './Header';
import Inventory from './Inventory';
import Order from './Order';

class App extends React.Component {
  render () {
    return (
      <div className="catch-of-the-day">
        <div className="menu">
          <Header tagline="Fresh Seafood Market" tagline="Halli Hallo" />
          <Header tagline="Halli Hallo"/>
        </div>
        <Order />
        <Inventory />
      </div>
    )
  }
}

export default App;
